import React from "react";
import "./styles.scss";

const Book = ({
    id,
    name,
    details,
    info,
    bookList,
}) => {
        return (
            <>
            <div className="box">   
          {!this.state.loading &&
            this.state.bookList.map((book) => <div>{book.title}</div>)}
        </div>
        {this.state.loading && <div>Loading...</div>}
            {/* <div className="box">
            <div>Name: {name}</div>
            <div>Info: {info}</div>
            </div> */}
            </>
        )
}

export default Book;
